import {BrowserRouter, Route, Routes } from 'react-router-dom'
import Home from './Home'
import Header from './Header';
import Insert from './Insert';

function App() {
  return (
    <BrowserRouter>      
      <Header/>
      <Routes>
        <Route path='' exact element={<Home/>}/> 
        <Route path='/insert' element={<Insert/>}/>    
      </Routes>
    </BrowserRouter>
  );
}

export default App;
